  /*METODOS RECLAMOS*/

  // Obtener todos los reclamos
  const obtenerTodosLosReclamos = async () => {
    const url = "http://localhost:8080/api/reclamos";
    const options = {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
      },
    };

    try {
      const response = await fetch(url, options);

      if (!response.ok) {
        const errorText = await response.text();
        throw new Error(`Error al obtener reclamos: ${errorText}`);
      }

      const data = await response.json();

      // Verificar que los datos sean un arreglo
      if (Array.isArray(data)) {
        // Formatear los datos para mostrarlos en el modal
        const formattedData = data.map((reclamo) => {
          const unidadInfo = reclamo.unidad
            ? `Piso: ${reclamo.unidad.piso}, Número: ${reclamo.unidad.numero}`
            : "N/A";

          return `
            <div class="reclamo-item">
              <strong>ID Reclamo:</strong> ${reclamo.numero || "N/A"} <br>
              <strong>Documento de Reclamante:</strong> ${
                reclamo.usuario ? reclamo.usuario.documento : "No disponible"
              } <br>
              <strong>Código de Edificio:</strong> ${
                reclamo.edificio ? reclamo.edificio.codigo : "N/A"
              } <br>
              <strong>Ubicación:</strong> ${reclamo.ubicacion || "No especificada"} <br>
              <strong>Identificador de Unidad:</strong> ${unidadInfo} <br>
              <strong>Descripción:</strong> ${
                reclamo.descripcion || "Sin descripción"
              } <br>
              <strong>Estado:</strong> ${reclamo.estado || "No especificado"} <br>
              <strong>Detalle Estado:</strong> ${
                reclamo.detalleEstado || "No disponible"
              } <br>
              <strong>Fecha:</strong> ${reclamo.fecha || "No especificada"} <br>
            </div>
            <hr>
          `;
        });

        // Actualizar el contenido del modal
        setModalContent(formattedData.join(""));
      } else {
        // Si no es un arreglo, muestra un mensaje vacío
        setModalContent("No se encontraron reclamos.");
      }

      setShowModal("mostrarTodosLosReclamos");
    } catch (error) {
      console.error("Error al obtener los reclamos:", error);
      alert(
        `Hubo un error al obtener los reclamos: ${
          error.message || "Error desconocido"
        }.`
      );
    }
  };


